import React from 'react'
import classNames from 'classnames';
export const SemaforoButton = (props) => {
  const value = props?.value;

  const buttonClasses = classNames({
    cell: true,
    winner: props.value
  })
  return (
    <button className={buttonClasses}>{value}</button>
  )
}
